import React from "react";
import { useState, useEffect, useMemo} from "react";
import "../App.css";
import mondaySdk from "monday-sdk-js";
import "monday-ui-react-core/dist/main.css";
import { Flex, Dropdown, Button } from "monday-ui-react-core";
import Nango from '@nangohq/frontend';



// Usage of mondaySDK example, for more information visit here: https://developer.monday.com/apps/docs/introduction-to-the-sdk/
const monday = mondaySdk();

export const Connector = () => {

  const optionsAvatar = useMemo(
    () => [
      {
        value: "facebook",
        label: "Facebook",
        // leftAvatar: person1,
      },
      {
        value: "instagram",
        label: "Instagram",
        // leftAvatar: person2,
      },
      {
        value: "google",
        label: "Google",
        // leftAvatar: person3,
      },
    ],
    []
  );

  const nango = new Nango({ publicKey: '7b73b776-3a10-41c0-a5ee-feef16d372d4' });

  const connect = () => {
    nango.auth('facebook', 'test-connection-id', { authorization_params: { config_id: '728465868571401' }})
    .then((result) => {
      console.log(result);
    }).catch((err) => {
      console.log(err)
    });
  }

  return  (
      <>
        <Flex gap={Flex.gaps.SMALL}>
          <Dropdown
            defaultValue={[optionsAvatar[0]]}
            options={optionsAvatar}
            multiline
            className="dropdown-stories-styles_with-chips"
          />
        </Flex>
        <Button onClick={() => connect()}>
          Button
        </Button>
      </>
      );
    };
